import React, { Component } from 'react';
import { BrowserRouter as Router, Routes, Route, Redirect } from 'react-router-dom';
import Landing from './routes/Landing';
import TestLink from './routes/exam/TestLink';
import StartTest from './routes/exam/StartTest';
import Result from './routes/exam/Result';
import { AuthContextProvider } from './context/authContext';
import Header from './components/Header';
import ProtectedRoutes from './components/ProtectedRoutes';

class App extends Component {

    render() {
        return (
            <div>
                <AuthContextProvider>
                <Header />
                    <Routes>
                        <Route exact path="/" element={ <ProtectedRoutes><Landing /></ProtectedRoutes> } />
                        <Route path="/testlink" component={ <ProtectedRoutes><TestLink /></ProtectedRoutes>  } />
                        <Route path="/starttest/:testid" component={ <ProtectedRoutes><StartTest /></ProtectedRoutes>  } />
                        <Route path="/result/:testid" component={ <ProtectedRoutes><Result /></ProtectedRoutes>  } />
                    </Routes>
                </AuthContextProvider>
            </div>
        )
    }
}



export default App;
